const path = require('path');
const fs = require('fs');

const writeFileRecursive = async (
  path,
  buffer
) => {
  const lastPath = path.substring(0, path.lastIndexOf('/'));
  try {
    // check folder exist, not then create folder
    if (!fs.existsSync(lastPath)) {
      await fs.promises.mkdir(lastPath, { recursive: true });
    }

    fs.writeFileSync(path, buffer);
   
  } catch (error) {
    debugger;
    console.error(`Failed to create file. ${path}`);
    return false;
  }
};

